about__title:{en:"Welcome to 1-Zip — your universal archiver for fast and efficient file compression and decompression!",sp:"Bienvenido a 1-Zip, su archivador universal para comprimir y descomprimir archivos de forma rápida y eficaz.",ru:"Добро пожаловать к 1-Zip — ваш универсальный архиватор для быстрого и эффективного сжатия и распаковки файлов!"},about__text:{en:"<p>1-Zip is an intuitive and powerful tool that will help you save time and space on your device. Whether you need to compress files for storage or share their content with others, 1-Zip provides a fast and reliable solution. 1-Zip is a highly compressed file archiver. You can use 1-Zip on any computer, including a computer in a commercial organization. You don't need to register or pay for 1-Zip.</p>",sp:"<p>1-Zip es una herramienta intuitiva y potente que le ayudará a ahorrar tiempo y espacio en su dispositivo. Tanto si necesita comprimir archivos para almacenarlos como si desea compartir su contenido con otras personas, 1-Zip le ofrece una solución rápida y fiable. 1-Zip es un archivador de archivos de alta compresión. Puede utilizar 1-Zip en cualquier ordenador, incluso en un ordenador de una organización comercial. No es necesario registrarse ni pagar por 1-Zip.</p>",ru:"<p>1-Zip — это интуитивно понятный и мощный инструмент, который поможет вам сэкономить время и место на вашем устройстве. Если вам нужно сжать файлы для хранения или поделиться их содержимым с другими, 1-Zip обеспечит быстрое и надежное решение. 1-Zip - это архиватор файлов с высокой степенью сжатия. Вы можете использовать 1-Zip на любом компьютере, включая компьютер в коммерческой организации. Вам не нужно регистрироваться или платить за использование 1-Zip.</p>"},license__title:{en:"License",sp:"Licencia",ru:"Лицензия"},license__text:{en:'\n\t\t\t\t<p><strong>Free usage:</strong> 1-Zip archiver is free to use for all users. You can <a href="download.html" target="_blank" class="link">download</a>, install, and use 1-Zip on any device for free.</p>\n\t\t\t\t<p><strong>Open source:</strong> 1-Zip has an open-source code, allowing users to view, modify, and distribute the software within the terms of the license.</p>\n\t\t\t\t<p><strong>Limitation of liability:</strong> 1-Zip developers are not liable for any direct or indirect damages, including data loss, loss of profit, or loss of ability to use the software, that may arise from the use or inability to use the 1-Zip software.</p>\n\t\t\t\t<p><strong>Copyrights:</strong> All rights to the 1-Zip software are protected by copyright. Users are prohibited from copying, modifying, or distributing the software without the consent of the developers.\n\t\t\t\t<p><strong>Acceptance of terms:</strong> By using the 1-Zip software, users automatically accept all the terms of this license.</p>\n\t\t\t\t<p>1-Zip is a free and open-source software licensed under the GNU LGPL license, with some parts of the code also licensed\n\t\t\t\t\tunder the BSD 3-clause License. Additionally, certain parts of the code are subject to the unRAR license restriction.\n\t\t\t\t\tRead <a href="files/1-Zip_License.txt" download class="link">1-Zip License</a> information</p>\n\t\t\t',sp:'\n\t\t\t\t<p><strong>Uso gratuito:</strong> El archivador 1-Zip es gratuito para todos los usuarios. Puede <a href="download.html" target="_blank" class="link">descargar</a>, instalar y utilizar 1-Zip en cualquier dispositivo de forma gratuita.</p>\n\t\t\t\t<p><strong>Código abierto:</strong> 1-Zip tiene un código abierto, lo que permite a los usuarios ver, modificar y distribuir el software dentro de los términos de la licencia.</p>\n\t\t\t\t<p><strong>Limitación de responsabilidad:</strong> Los desarrolladores de 1-Zip no se hacen responsables de ningún daño directo o indirecto, incluida la pérdida de datos, el lucro cesante o la pérdida de capacidad para utilizar el software, que pueda derivarse del uso o la imposibilidad de uso del software de 1-Zip.</p>\n\t\t\t\t<p><strong>Derechos de autor:</strong> Todos los derechos del software 1-Zip están protegidos por copyright. Se prohíbe a los usuarios copiar, modificar o distribuir el software sin el consentimiento de los desarrolladores.\n\t\t\t\t<p><strong>Aceptación de las condiciones:</strong> Al utilizar el software 1-Zip, los usuarios aceptan automáticamente todos los términos de esta licencia.</p>\n\t\t\t\t<p>1-Zip es un software libre y de código abierto licenciado bajo la licencia GNU LGPL, con algunas partes del código también \n\t\t\t\t\tlicenciadas bajo la Licencia BSD de 3 cláusulas. Additionally, certain parts of the code are subject to the unRAR license restriction. \n\t\t\t\t\tLea la información sobre la <a href="files/1-Zip_License.txt" download class="link">licencia de 1-Zip</a></p>\n\t\t\t',ru:'\n\t\t\t\t<p><strong>Бесплатное использование:</strong> Архиватор 1-Zip бесплатен для всех пользователей. Вы можете бесплатно <a href="download.html" target="_blank" class="link">скачать</a>, установить и использовать 1-Zip на любом устройстве.</p>\n\t\t\t\t<p><strong>Открытый исходный код:</strong> 1-Zip имеет открытый исходный код, что позволяет пользователям просматривать, изменять и распространять программу в соответствии с условиями лицензии.</p>\n\t\t\t\t<p><strong>Ограничение ответственности:</strong> Разработчики 1-Zip не несут ответственности за любые прямые или косвенные убытки, включая потерю данных, упущенную выгоду или потерю возможности использовать программное обеспечение, которые могут возникнуть в результате использования или невозможности использования программного обеспечения 1-Zip.</p>\n\t\t\t\t<p><strong>Авторские права:</strong> Все права на программное обеспечение 1-Zip защищены авторским правом. Пользователям запрещается копировать, изменять или распространять программное обеспечение без согласия разработчиков.\n\t\t\t\t<p><strong>Принятие условий:</strong> Используя программу 1-Zip, пользователи автоматически принимают все условия этой лицензии.</p>\n\t\t\t\t<p>1-Zip - это свободное программное обеспечение с открытым исходным кодом, лицензируемое по лицензии GNU LGPL, а некоторые части кода \n\t\t\t\t\tтакже лицензируются по лицензии BSD 3-clause License. Кроме того, на некоторые части кода распространяется ограничение лицензии unRAR. \n\t\t\t\t\tПрочитать информацию о <a href="files/1-Zip_License.txt" download class="link">лицензии 1-Zip</a></p>\n\t\t\t'},
